<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="utf-8" />

    <title>@storybook/cli - Storybook</title>
    <meta name="viewport" content="width=device-width, initial-scale=1" />

    
    <link rel="icon" type="image/svg+xml" href="./favicon.svg" />
    

    <link rel="preload" href="./sb-common-assets/nunito-sans-regular.woff2" as="font" type="font/woff2" crossorigin />
    <link rel="preload" href="./sb-common-assets/nunito-sans-bold.woff2" as="font" type="font/woff2" crossorigin />
    <link rel="stylesheet" href="./sb-common-assets/fonts.css" />

     <style>
    .os-content {
        padding-top: 0.5rem !important;
    }
</style>
 

    <style>
      #storybook-root[hidden] {
        display: none !important;
      }
    </style>

    
  </head>
  <body>
    <div id="root"></div>

    
    <script>
      
        
          window['FEATURES'] = {
  "warnOnLegacyHierarchySeparator": true,
  "buildStoriesJson": false,
  "storyStoreV7": true,
  "breakingChangesV7": true,
  "interactionsDebugger": false,
  "argTypeTargetsV7": true
};
        
      
        
          window['REFS'] = {};
        
      
        
          window['LOGLEVEL'] = "info";
        
      
        
          window['DOCS_OPTIONS'] = {
  "disable": false,
  "defaultName": "Docs",
  "autodocs": true
};
        
      
        
          window['CONFIG_TYPE'] = "PRODUCTION";
        
      
        
      
        
      
        
      
        
      
    </script>
    

    <script type="module">
      import './sb-manager/runtime.mjs';

      import './sb-addons/essentials-controls-1/manager-bundle.mjs';
      
      import './sb-addons/essentials-actions-2/manager-bundle.mjs';
      
      import './sb-addons/essentials-backgrounds-3/manager-bundle.mjs';
      
      import './sb-addons/essentials-viewport-4/manager-bundle.mjs';
      
      import './sb-addons/essentials-toolbars-5/manager-bundle.mjs';
      
      import './sb-addons/essentials-measure-6/manager-bundle.mjs';
      
      import './sb-addons/essentials-outline-7/manager-bundle.mjs';

      import './sb-addons/storybook-9/manager-bundle.mjs';

    <link href="./sb-preview/runtime.mjs" rel="preload" as="script" />
